import React from 'react';
import './navbar.css';
import logo from '../../assests/Images/logo.jpeg';
import contactImg from '../../assests/Images/contact.png';
// import btnImge from '../../assests/Images/hireme.png';
import {Link} from 'react-scroll';

const Navbar=()=> {
  return (
    <nav class='navbar'>
      <img className='logo' src={logo} alt="" style={{width:"5rem"}} />

      <div className='navcenter'>
      <div className="menu">
        <span></span>
        <span></span>
        <span></span>
       </div>



          <Link className="navitems">Home</Link>
          <Link className="navitems">About</Link>
          <Link className="navitems">Portofolio</Link>
          <Link className="navitems">Clients</Link>


      </div>
      <button class="navcontact ">
       <img src={contactImg} class="navbarcontactimg" alt="" />
       Contact Me

      </button>


    </nav>
  )
}

export default Navbar;
